import React from 'react';
import ReactDOM from 'react-dom';
let Person = (props) => <h1> Welcome {props.name} and {props.age} </h1>
class App extends React.Component{
  constructor(name,age){
    super();
    this.state = {
      name: name,
      age: age

    }
  }
  render(){
    return (
      <div>
        <Text name={this.state.name} age={this.state.age} />
      </div>
    )
  }

}
let person = new App("Seytech",29)

